import React, { useState } from "react";
import { Container, Form } from "react-bootstrap";
import { Link } from "react-router-dom";
import { FaFacebookF, FaYoutube, FaInstagram } from "react-icons/fa";
import { SiGmail } from "react-icons/si";
import validate from "./validate";
import useForm from "./useForm";

const Register = ({ submitForm }) => {
  const { handleChange, handleSubmit, values, errors } = useForm(
    submitForm,
    validate
  );
  
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');

  return (
    <Container className="single-forms">
      <h3 className="title">Create your account</h3>
      <Form onSubmit={handleSubmit} className="box" noValidate>
        <Form.Group controlId="registerName">
          <Form.Label className="form-subtitle">Full Name</Form.Label>
          <Form.Control
            type="text"
            placeholder="Full Name"
            name="fullname"
            value={values.fullname} 
            onChange={handleChange}
          />
          {errors.fullname && <p>{errors.fullname}</p>}
        </Form.Group>
        <Form.Group controlId="registerEmail">
          <Form.Label className="form-subtitle">E-mail</Form.Label>
          <Form.Control
            type="email"
            placeholder="Email"
            name="email"
            value={values.email}
            onChange={handleChange}
          />
          {errors.email && <p>{errors.email}</p>}
        </Form.Group>
        <Form.Group controlId="registerPhone">
          <Form.Label className="form-subtitle">Phone</Form.Label>
          <Form.Control type="email" placeholder="Phone" />
        </Form.Group>
        <Form.Group controlId="signinPassword">
          <Form.Label className="form-subtitle">Password</Form.Label>
          <Form.Control
            type="password"
            placeholder="Password"
            name="password"
            value={values.password}
            onChange={handleChange}
          />
          {errors.password && <p>{errors.password}</p>}
        </Form.Group>
        <Form.Group controlId="registerConfirmPassword">
          <Form.Label className="form-subtitle">Confirm Password</Form.Label>
          <Form.Control
            type="password"
            placeholder="Confirm Password"
            name="password2"
            value={values.password2}
            onChange={handleChange}
          />
          {errors.password2 && <p>{errors.password2}</p>}
        </Form.Group>

        <button type="submit" color="primary" className="btn button">
          Register
        </button>
        <div className="social">
          <Link to="/" className="facebook">
            <FaFacebookF />
          </Link>
          <Link to="/" className="youtube">
            <FaYoutube />
          </Link>
          <Link onTouchCancelCapture="/" className="instagram">
            <FaInstagram />
          </Link>
          <Link to="/" className="gmail">
            <SiGmail />
          </Link>
        </div>
      </Form>
      <div className="alt-box">
        <div className="links">
        Already have an account?
          <Link to="/signin" className="link-title">
            {" "}
            Sign In
          </Link>
        </div>
      </div>
      <div className="alt-links">
        <Link to="/">Terms</Link>
        <Link to="/">Privacy</Link>
        <Link to="/">Security</Link>
        <Link to="/">Contact</Link>
      </div>
    </Container>
  );
};

export default Register;
